script: |
  super -f text -I q2126.spq | sort > q2126.out

inputs:
  - name: q2126.spq
    data: |
      SELECT - + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT ( col1 ) * - + col1 * + col0 / + - 93 / col0 IS NULL;
  - name: tab1

outputs:
  - name: q2126.out
    data: |
      -59
      -68
      -96
